import React, { useState, useEffect } from 'react'
import '../stylesheets/check.css'
import axios from 'axios';

function Download() {
  const [data, setData]=useState({})
  const [file, setFile]=useState(null);
  const [title, setTitle]=useState(null);
  const url="http://localhost:3000/Check"
  const url2="http://localhost:3000/upload"
useEffect(()=>{
  axios.get(url).then(res=>{
    setData(res.data)
  })
},[])
const handleFileUpload = (event)=>{
  setFile(event.target.files[0].name);

   }

   const handleSubmit = async(event) => {
    event.preventDefault()
    const formData = new FormData();
    formData.append("selectedFile", file);
    try {
      const response = await axios({
        method: "post",
        url: url2,
        data: formData , title,
        headers: { "Content-Type": "multipart/form-data" },
      });
    } catch(error) {
      console.log(error)
    }
  }




  return(
      <div className='check_download'>
       <div className='welcome_download'>
        <div className='user'>Welcome !: {data.name} {data.surname} </div>
        </div>
        <div className='main_download'>
         <form onSubmit={(e)=>handleSubmit(e)} className='form_download'>
          <div className='flex justify-center'>
          <div>Hello!</div>
           <div>You can download your vidoes in this page</div>
           </div>
           <div className='templates_download'>

          <div className='flex gap-5'>
            <p>Download </p>
          <input type='file' accept='.mp4' onChange={handleFileUpload} required/>
          </div>
          <input type='file' accept='.png' onChange={handleFileUpload} required />
          <input type='text' onChange={(e)=>setTitle(e.target.value)} placeholder='Your title about video' required/>
          </div>
          <button>submit</button>

         </form>

      </div>
      </div>
  )
}

export default Download;
